    "2016-07-27T22:21:12.074642",nt"name": "water-management-plan-1976",nt"isopen":
    false,nt"url": null,nt"notes": "Approximately 25,150 acres of freshwater
    marsh, fresh meadows, and season-ally flooded basins dominate the 37,631-acre refuge
    [RBL NWR].The broad objectives of Ruby Lake Refuge are those of the National Wildlife
    Refuge System (U. S. Fish and Wildlife Service 1976b}. In order of priority specific
    objectives for wetland management are: 1. Management for a diverse natural wetland
    ecosystem. 2. Management for canvasback and redhead production and maintenance.
    3. Management for production and maintenance of other waterfowl and migratory birds.
    4. Management for on refuge wildlife oriented education and recreation. 5. Management
    for locally important fishery.",nt"license_title": "License Not Specified",nt"extras":
